(182, 34, 'apartment', 'Apartment', 'rent', 'Kabul', 'Kabul', '10', 'Saleem Karwan', 'm2', '70', NULL, '3', '1', '300', '[\"1542103504_43.jpeg\"]', 'It is a modern building near the Saleem Karwan square. The apartment is on the fifth floor and it has modern rooms, exposed to direct sunlight. There are also shops in the first floor, so you can live upstairs and start your own shop downstairs. The surrounding of the building is also fenced and it has a big parking lot for cars inside the fenced area. There is also another apartment at the same floor with 4 rooms and $400 rental price.\r\nیک اپارتمان عصری در نزدیکی چوک سلیم کاروان. آپارتمان در منزل ۳ واقع بوده و دارای اطاق های روشن و آفتاب رخ میباشد. چهار اطراف تعمیر دیوار فلزی داشته و دارای پارکنگ بزرگ وسایط نیز میباشد. در منزل اول این اپارتمان دوکاکین برای کرایه نیز وجود دارد. یک اپارتمان ۴ اطاقه نیز در همان منزل بوده که به ۴۰۰ دالر به کرایه داده میشود', '34.5564562', '69.16072689999999', '2018-11-13 17:05:04', '2018-11-14 16:57:36'),
(118, 21, 'apartment', 'Apartment', 'lease', 'Kabul', 'Kabul', '4', 'Baraki', 'm2', '325', NULL, '4', '2', '40000', '[\"IMG-20181017-WA0021.jpg\",\"IMG-20181017-WA0022.jpg\",\"IMG-20181017-WA0023.jpg\",\"IMG-20181017-WA0024.jpg\"]', 'A modern apartment with two balconies, an open kitchen and tiled hallway. The apartment is located on the fifth floor and is receives direct sunlight. The building also includes parking garage for vehicles.  \r\nیک باب اپارتمان ۴ اطاقه آفتاب رخ، با آشپزخانه باز، دهلیز کاشی کاری شده و بالکن بوده که فضا برای پارکنگ موتر را نیز دارا میباشد', '34.53841759999999', '69.14439530000004', '2018-11-10 18:00:32', '2018-11-13 16:57:19'),
(116, 21, 'apartment', 'Apartment', 'rent', 'Kabul', 'Kabul', '4', 'Kolola Peshta', 'm2', '110', NULL, '3', '2', '300', '[\"IMG-20181017-WA0019.jpg\",\"IMG-20181017-WA0020.jpg\"]', 'The apartment has 3 furnished rooms and is equipped with central heating system. \r\n.یک باب آپارتمان ۳ اطاقه مجهز با سیستم مرکز گرمی و اطاق های فرش شده مناسب برای یک فامیل متوسط', '34.5405619', '69.15907500000003', '2018-11-10 17:54:40', '2018-11-13 16:08:06'),
(117, 21, 'apartment', 'Apartment', 'rent', 'Kabul', 'Kabul', '4', 'Baraki', 'm2', '325', NULL, '3', '1', '1000', '[\"IMG-20181018-WA0000.jpg\"]', 'A modern first floor apartment that also includes an immense basement.\r\nیک باب اپارتمان ۳ اطاقه که دارای یک تهکوی بزرگ نیز میباشد برای کرایه داده میشود', '34.53841759999999', '69.14439530000004', '2018-11-10 17:57:54', '2018-11-13 16:45:39'),
(188, 35, 'apartment', 'Apartment', 'sell', 'Kabul', 'Kabul', '10', 'Qalai Fatehullah', 'm2', '130', NULL, '3', '2', '85000', '[\"1542105248_47.jpeg\"]', 'A modern apartment in Yonus Tower in Qalai Fatehullah. The tower is adjacent to the main street and has left and central heating system. It is a newly built apartment on the fifth floor and has large and bright rooms. It also has a modern kitchen and a balcony. \r\nیک باب اپارتمان ۳ اطاقه عصری در  یونس تاور در نبش سرک عمومی قلعه فتح الله بوده، دارای لفت و مرکز گرمی میباشد. اطاق های این اپارتمان تازه از ساخت و ساز خلاص شده و آماده  فروش است. این اپارتمان دارای اطاق های روشن ، آشپزخانه و بالکن آفتاب رخ میباشد', '34.5553974', '69.1715302', '2018-11-13 17:34:08', '2018-11-14 17:19:39'),
(189, 35, 'apartment', 'Apartment', 'sell', 'Kabul', 'Kabul', '10', 'Qalai Fatehullah', 'm2', '130', NULL, '3', '2', '85000', '[\"1542105437_48 (1).jpeg\",\"1542105437_48 (2).jpeg\"]', 'A modern apartment in Yonus Tower in Qalai Fatehullah. The tower is adjacent to the main street and has left and central heating system. It is a newly built apartment on the sixth floor and has large and bright rooms. It also has a modern kitchen and a balcony. \r\nیک باب اپارتمان ۳ اطاقه عصری در  یونس تاور در نبش سرک عمومی قلعه فتح الله بوده، دارای لفت و مرکز گرمی میباشد. اطاق های این اپارتمان تازه از ساخت و ساز خلاص شده و آماده  فروش است. این اپارتمان دارای اطاق های روشن ، آشپزخانه و بالکن آفتاب رخ میباشد', '34.5553974', '69.1715302', '2018-11-13 17:37:17', '2018-11-14 17:20:17'),
(190, 35, 'apartment', 'Apartment', 'sell', 'Kabul', 'Kabul', '10', 'Qalai Fatehullah', 'm2', '525', NULL, '9', '7', '280000', '[\"1542105728_49 (1).jpeg\",\"1542105728_49 (2).jpeg\",\"1542105728_49 (3).jpeg\",\"1542105728_49 (4).jpeg\",\"1542105728_49 (5).jpeg\",\"1542105728_49 (6).jpeg\",\"1542105728_49.jpeg\"]', 'A modern VIP apartment in Yonus Tower in Qalai Fatehullah. The tower is adjacent to the main street and has left and central heating system. It is a newly built apartment on the seventh floor and has large and bright rooms. It also has a modern kitchen, a balcony and can be partitioned into two apartments.\r\nیک باب اپارتمان ۹ اطاقه عصری در  یونس تاور در نبش سرک عمومی قلعه فتح الله بوده، دارای لفت و مرکز گرمی میباشد. اطاق های این اپارتمان تازه از ساخت و ساز خلاص شده و آماده  فروش است. این اپارتمان دارای اطاق های \r\n روشن ، آشپزخانه و بالکن آفتاب رخ میباشد. شما همچنان میتوانید آن را به دو آپارتمان جداگانه تقسیم نموده و برای دو فامیل استفاده کرد', '34.5553974', '69.1715302', '2018-11-13 17:42:08', '2018-11-14 17:24:25'),
(121, 23, 'apartment', 'Apartment', 'rent', 'Kabul', 'Kabul', 'District 9, Macroyan 4', 'Makroyan 4', 'biswa', '1', NULL, '3', '2', '250', '[\"F.zai.1.1.jpeg\"]', 'The apartment is in a peaceful environment and can be easily accessible by a vehicle.  It is on the fourth floor and has a big parking lot in the basement of the building. The rooms are large and receive direct sunlight during the day. The wall paintings are in good condition too. Some rooms also include cupboards attached to the wall.\r\nاین اپارتمان ۳ اطاقه در مکرویان ۴ موقعیت دارد. دارای فضای امن و آرام است و راه رو موتر نیز دارد. طبقه زیر زمینی آن به حیث پارکنگ موتر استفاده میگردد و خود آپارتمان در منزل چهار واقع است. دارای اطاق های بزرگ و آفتاب رخ میباشد و رنگ دیوار های آن نیز تازه میباشد. بعضی اطاق های آن دارای الماری های چسپیده به دیوار نیز است', '34.540716', '69.20423579999999', '2018-11-11 13:52:28', '2018-11-21 17:26:47'),
(122, 24, 'apartment', 'Apartment', 'rent', 'Kabul', 'Kabul', 'District 4, Shahre Naw', 'Shahre Naw', 'm2', '50', NULL, '2', '2', '220', '[\"1542262500Shahji.1.0.jpeg\",\"1542262500Shahji.1.1.jpeg\",\"1542262500Shahji.1.2.jpeg\"]', 'The apartment is furnished and ready to move in. Situated on the 4th floor and accessible by an elevator. Its a highly secure tower with guards watching the doors all the time. The apartment is modernly designed with freshly painted walls, rooms that receive direct sunlight and tiled hallway.  \r\nاین آپارتمان مجهز با فرنیچر در منزل چهار واقع بوده و آماده برای زنده گی کردن میباشد. تعمیر آن مجهز با لفت بوده و از تدابیر امنیتی بالای برخوردار میباشد. دارای اطاق های بزرگ، روشن و آفتاب رخ است و دهلیز آن کاشی کاری شده نیز میباشد', '34.5289109', '69.1715302', '2018-11-11 14:03:28', '2018-11-21 17:35:20'),
(111, 20, 'house', 'House / Office', 'Rent', 'Kabul', 'Kabul', '4', 'Shahre Naw', 'biswa', '10', '3', '38', '38', '8000', '[\"WhatsApp Image 2018-10-24 at 09.57.43.jpeg\",\"WhatsApp Image 2018-10-24 at 09.57.51.jpeg\",\"WhatsApp Image 2018-10-24 at 09.57.55.jpeg\",\"WhatsApp Image 2018-10-24 at 09.58.00.jpeg\"]', 'A modern house  with two way entry and a big parking garage. The rooms receive  direct sunlight during the day and you can also partition it into two houses and use the house for two families.  It has 6 kitchens, multiple balconies and tiled hallways. You can also use it for your office. \r\nخانه سه منزله‌ مدرن با دو راه  ورودی، اطاق های آفتاب رخ، ۶ آشپزخانه، گراچ برای وسایط و بالکن های متعدد. در بهترین موقعیت شهرنو. این خانه را همچنان میتوانید به دو منزل رهایشی تقسیم نموده و برای دو فامیل استفاده کنید. یک انتخاب عالی برای خانه مسکونی و یا هم دفتر کاری شما', '34.5289109', '69.1715302', '2018-11-10 17:07:32', '2018-11-13 14:15:19'),
(112, 20, 'house', 'House / Office', 'Rent', 'Kabul', 'Kabul', '10', 'Sherpur', 'biswa', '4', '4', '12', '38', '1400', '[\"WhatsApp Image 2018-10-24 at 09.58.01.jpeg\",\"WhatsApp Image 2018-10-24 at 09.58.02 (1).jpeg\",\"WhatsApp Image 2018-10-24 at 09.58.02.jpeg\"]', 'A modern furnished house located in Sherpur street. The house includes spacious roof and balcony. The rooms also receives direct sunlight during the day. The house can also be used as an office.\r\nخانه چهار  منزله‌ مدرن همراه با تهکوی، اطاق های آفتاب رخ، آشپزخانه مدرن، گراچ برای وسایط و بالکن. در بهترین موقعیت شیرپور. یک انتخاب عالی برای خانه مسکونی و یا هم دفتر کاری شما.', '34.5372713', '69.17462439999997', '2018-11-10 17:16:50', '2018-11-13 14:40:07'),
(113, 20, 'house', 'House / Office', 'rent', 'Kabul', 'Kabul', '10', 'Sherpur', 'biswa', '4', '4', '14', '7', '1500', '[\"WhatsApp Image 2018-10-24 at 09.58.03.jpeg\",\"WhatsApp Image 2018-10-24 at 09.58.04.jpeg\",\"WhatsApp Image 2018-10-24 at 09.58.05.jpeg\"]', 'A modern furnished house located in Sherpur street. The house includes spacious basement and a balcony. The rooms are furnished and has freshly painted walls. The house can also be used as an office.\r\nخانه چهار  منزله‌ مدرن همراه با تهکوی، اطاق های فرش شده، آشپزخانه مدرن، گراچ برای وسایط و بالکن. در بهترین موقعیت شیرپور. یک انتخاب عالی برای خانه مسکونی و یا هم دفتر کاری شما', '34.53791729999999', '69.17004010000005', '2018-11-10 17:32:28', '2018-11-13 14:45:21'),
(173, 34, 'shop', 'shop', 'rent', 'Kabul', 'Kabul', '10', 'Saleem Karwan', 'm2', '195', NULL, NULL, NULL, '800', '[\"1542095470_37 (1).jpeg\",\"1542095470_37 (2).jpeg\"]', 'It is a big shop where you can start your own supermarket, grocery store or even a pharmacy. It can also be connected to the adjacent shops, so you can rent it as your office too. It is located in Saleem Karwan square and above the shops, there are residential apartments. So, you already have the market for your shop. Some of the apartments are also for rent and you can rent both your apartment and your shop at the same place. \r\nاین دوکان در چهارراهی سلیم کاروان موقعیت داشته و بهترین مکان برای آغاز دوکان سوپر مارکیت و یا هم درملتون شما است. چون این دوکان به دوکان های پهلوی خود نیز وصل شده میتواند شما میتوانید آن را به حیث دفتر کاری خود نیز استفاده نمایید. در بالای این دوکان اپارتمان های رهایشی نیز وجود دارد و شما میتوانید هم اپارتمان و هم دوکان خود را در یک مکان به کرایه بگیرید', '34.5564562', '69.16072689999999', '2018-11-13 14:51:10', '2018-11-15 16:13:43'),
(174, 20, 'house', 'House / Office', 'rent', 'Kabul', 'Kabul', '10', 'Wazir Akbar Khan', 'biswa', '5', '2', '11', '8', '2000', '[\"1542098143_4 (1).jpg\",\"1542098143_4 (4).jpg\",\"1542098143_4 (6).jpg\"]', 'A modern house located in Wazir Akbar Khan. The house includes 2 immense lounges and a tiled courtyard with a beautiful garden. The rooms receive direct sunlight during the day and you can use the property as your office too. \r\nخانه دو منزله‌ مدرن دارای اطاق های آفتاب رخ، آشپزخانه مدرن، گراچ برای وسایط و بالکن. این منزل رویای دارای دو صالون و صحن حویلی با باغچه گل کاری شده میباشد. بهترین انتخاب برای خانه و یا دفتر کاری شما', '34.5363261', '69.18345099999999', '2018-11-13 15:35:43', '2018-11-13 15:35:43'),
(115, 20, 'house', 'House / Office', 'rent', 'Kabul', 'Kabul', '4', 'Shahre Naw', 'biswa', '16', '2', '20', '20', '6000', '[\"IMG-20181017-WA0014.jpg\",\"IMG-20181017-WA0015.jpg\",\"IMG-20181017-WA0017.jpg\",\"IMG-20181017-WA0018.jpg\"]', 'A perfect house in a perfect location. The house in in Shahre Naw and includes a beautiful garden with tiled surrounding, 3 immense halls, air conditioned rooms and bullet proof doors. It is also a great place to open your office without any security concerns. \r\nخانه دو منزله‌ مدرن دارای اطاق های کاشی کاری شده و مجهز با ایرکندیشن، آشپزخانه عصری، گراچ برای وسایط و بالکن. این منزل رویای دارای ۳ صالون و صحن حویلی با باغچه گل کاری شده میباشد. همچنان، این خانه دارای اطاق های زره بوده و بهترین مکان برای دفتر کاری نیز میباشد', '34.5289109', '69.1715302', '2018-11-10 17:44:57', '2018-11-13 15:57:06'),
(254, 41, 'apartment', 'Apartment', 'sell', 'Kabul', 'Kabul', '4', 'Taimani Project', 'm2', '118', NULL, '3', '2', '55000', '[\"1542619120_WhatsApp Image 2018-11-19 at 11.19.04.jpeg\",\"1542619120_WhatsApp Image 2018-11-19 at 11.19.53.jpeg\"]', 'A modern and newly constructed apartment in Khurshid Tower located in Taimani Project. The tower is adjacent to the street and is equipped with left and central heating system. The basement is used as the parking lot. The apartment is on the fourth floor and has large and bright rooms, modernly designed kitchen with tiled walls, large hallway and a balcony. The apartment is already on sale and the interior decoration of the apartments will finish soon.\r\nاین باب اپارتمان ۳ اطاقه عصری و نو ساخت در  خورشید تاور در سرک دوم پروژه تایمنی موقعیت دارد و با سیستم لفت و مرکز گرمی مجهز میباشد. این اپارتمان در منزل ۴ است و و دارای اطاق های بزرگ و روشن، آشپزخانه زیبا با دیوار های کاشی کاری شده، دهلیز بزرگ و بالکن آفتاب رخ میباشد. همچنان، زیرزمینی این تاور به حیث پارکنگ وسایط استفاده میشود. آپارتمان های این تاور به فروش گذاشته شده و به زودی دیکوریشن داخل آن تمام خواهد شد', '34.5575144', '69.15364879999993', '2018-11-19 16:18:40', '2018-11-19 16:18:40'),
(362, 39, 'apartment', 'Apartment', 'rent', 'Kabul', 'Kabul', '4', 'Taimani', 'm2', '120', NULL, '4', '2', '300', '[\"1545647007_WhatsApp Image 2018-12-14 at 22.55.14.jpeg\",\"1545647007_WhatsApp Image 2018-12-14 at 22.55.24.jpeg\",\"1545647007_WhatsApp Image 2018-12-14 at 22.55.31.jpeg\",\"1545647007_WhatsApp Image 2018-12-14 at 22.55.33.jpeg\",\"1545647007_WhatsApp Image 2018-12-14 at 22.55.38.jpeg\",\"1545647007_WhatsApp Image 2018-12-14 at 22.55.39.jpeg\",\"1545647007_WhatsApp Image 2018-12-14 at 22.55.40.jpeg\",\"1545647007_WhatsApp Image 2018-12-14 at 22.55.42.jpeg\",\"1545647007_WhatsApp Image 2018-12-14 at 22.55.43.jpeg\",\"1545647007_WhatsApp Image 2018-12-14 at 22.55.46.jpeg\",\"1545647007_WhatsApp Image 2018-12-14 at 22.55.49.jpeg\"]', 'It is a modern apartment in Taimani. The apartment is on the first floor and includes a big hall and a parking garage. The rooms are fairly large and receives direct sunlight. It also has beautiful interior decoration and built in cabinets.\r\nاین اپارتمان ۴ اطاقه در تایمنی موقعیت دارد و در منزل اول میباشد. دارای صالون بزرگ و گراچ برای وسایط نیز میباشد. اطاق های آن بزرگ، آفتاب رخ و روشن بوده و با دیزاین زیبا طراحی گردیده است. همچنان، اطاق های آن دارای الماری های زیبا نیز میباشد', '34.5442741', '69.16109940000001', '2018-12-24 17:23:27', '2018-12-24 17:23:27'),
