(224, 38, 'apartment', 'Apartment', 'sell', 'Kabul', 'Kabul', '15', 'Khair Khana', 'm2', '126', NULL, '3', '2', '60000', '[\"154228061474 (1).jpeg\",\"154228061474 (2).jpeg\",\"154228061474 (3).jpeg\",\"154228061474 (4).jpeg\",\"154228061474 (5).jpeg\",\"154228061474 (6).jpeg\"]', 'The apartment is on the 5th floor and facing the sun. It is equipped with Air conditioning system, has a parking lot and a balcony with a beautiful view where you can enjoy your cup of tea with friends and family. It has a modern open kitchen and the walls are decorated with wooden panels.\r\n این آپارتمان آفتاب رخ در منزل ۵  واقع بوده دارای ایر کندیشن، آشپزخانه باز و بالکن با منظره زیبا میباشد. دیوار های داخل آپارتمان با پنل های چوبی زیبا تزیین گردیده است و تعمیر این آپارتمان شامل گراچ وسایط نیز میباشد', '34.5786831', '69.12384599999996', '2018-11-15 14:37:26', '2018-11-15 18:16:54'),
(225, 38, 'apartment', 'Apartment', 'sell', 'Kabul', 'Kabul', '15', 'Khair Khana', 'm2', '126', NULL, '4', '2', '45000', '[\"154244429675 (1).jpeg\",\"154244429675 (2).jpeg\",\"154244429675 (3).jpeg\",\"154244429675 (4).jpeg\",\"154244429675 (5).jpeg\"]', 'The apartment is on the sixth floor of the building, adjacent to the main street in Khair Khana. The rooms are large, receive direct sunlight during the day and the wall paintings are fresh and new. The interior walls are decorated with beautiful wood panels and it is also equipped with Air conditions and central heating system. It has two balconies on both sides of the apartment, an open kitchen and a spacious rooftop where you can have a full view of the kabul city.\r\n این اپارتمان عصری و مدرن در منزل ۶  در پهلوی سرک عمومی در خیر خانه موقعیت دارد. آپارتمان دارای، آشپزخانه عصری و باز، اطاق های بزرگ، روشن و آفتاب رخ میباشد. رنگ دیوار های این آپارتمان روشن و تازه بوده و با دیوار های چوبی تزیین گردیده است. اطاق های آپارتمان دارای ایر کندیشن و سیستم مرکز گرمی بوده و به هر دو طرف آپارتمان بالکن های آفتاب رخ میباشد. همچنان، دارای تخت بام بزرگ بوده که از آنجا میتوانید منظره زیبا شهر کابل را مشاهده کرد', '34.5786831', '69.12384599999996', '2018-11-15 14:43:34', '2018-11-17 15:44:56'),
(249, 39, 'house', 'House / Office', 'rent', 'Kabul', 'Kabul', '4', 'Taimani', 'biswa', '3', '1', '4', '2', '300', '[\"1542445116_76 (1).jpeg\",\"1542445116_76 (2).jpeg\",\"1542445116_76 (4).jpeg\",\"1542445116_76 (6).jpeg\",\"1542445116_76 (7).jpeg\"]', 'Your dream house in Taimani square. The building is in great shape and has an spacious and green yard with planted trees. It also has furnished halls, rooms that receive direct sunlight during the day, two way garage and fine security measurements. You can also consider using it as your office.\r\n یک تعمیر عالی برای فامیل شما. این تعمیر دارای حویلی بزرگ و سرسبز، صالون فرش شده، اطاق های آفتاب رخ،  گراچ دو طرفه برای موتر و در نزدیکی سرک عمومی میباشد. همچنان، دیوار های بیرون آن با سیم خاردار مجهز بوده و یک انتخاب خوب برای دفاتر کاری نیز میباشد', '34.5442741', '69.16109940000001', '2018-11-17 15:58:36', '2018-11-19 14:35:40'),
