(241, 40, 'shop', 'Supermarket', 'rent', 'Kabul', 'Kabul', '10', 'Taimani', 'm2', '350', NULL, NULL, NULL, '3000', '[\"1542437033_59.jpeg\"]', 'It is a spacious place where you can start your own supermarket, grocery store or even a pharmacy. It is a modern shop and it also includes a room for an office. The shop is adjacent to the Taimani street and above the shop there are residential apartments, so you already have your first customers. The place is also for lease at a price of $100,000.\r\nاین دوکان درسرک اول تایمنی موقعیت دارد و بهترین مکان برای آغاز دوکان، سوپر مارکیت و یا هم درملتون شما است. دوکان مدرن بوده و شامل یک اطاق برای دفتر نیز میباشد. در بالای این دوکان اپارتمان های رهایشی نیز وجود دارد و شما میتوانید هم اپارتمان و هم دوکان خود را در یک مکان به کرایه بگیرید. این جایداد به ۱۰۰,۰۰۰ دالر به گرو نیز داده میشود', '34.5442741', '69.16109940000001', '2018-11-17 13:43:53', '2018-11-17 13:47:26'),
(242, 40, 'house', 'House / Office', 'sell', 'Kabul', 'Kabul', '10', 'Taimani', 'biswa', '10', '2', '20', '8', '800000', '[\"1542446775WhatsApp Image 2018-11-04 at 15.19.59 (1).jpeg\",\"1542446775WhatsApp Image 2018-11-04 at 15.19.59.jpeg\"]', 'If you want to live with your family, open your office, university or school, this is the perfect choice for you. The building is situated beside the first street of Taimani and is in perfect condition and has 2 two story buildings. It has a big parking lot that can accommodate 5 vehicles at the same time. It also has good security measurements and has barbed wires over the walls. It is currently rented to Kardan institute and has good income because of its location. \r\n اگر میخواهید با فامیل تان زنده گی کنید، دفتر، پوهنتون و یا هم مکتب شخصی خود را باز نمایید، این جایداد بهترین انتخاب برای شما است. این تعمیر دارای حویلی بزرگ و سرسبز، دهلیز های کاشی کاری شده، بالکن آفتاب رخ و  سالون کنفرانس میباشد. گراچ آن همزمان ظرفیت ۵ موتر را دارا ست. دارای تدابیر خوب امنیتی نیز بوده و دیوار های بیرون آن با سیم خاردار امن گردیده است. این تعمیر زیبا اکنون به انستییتیوت کاردان به کرایه داده شده است', '34.5571285', '69.13881900000001', '2018-11-17 13:59:34', '2018-11-17 16:26:15'),
