(255, 41, 'apartment', 'Apartment', 'sell', 'Kabul', 'Kabul', '4', 'Taimani Project', 'm2', '136', NULL, '3', '2', '55000', '[\"1542620093_98 (1).jpeg\",\"1542620093_98 (2).jpeg\",\"1542620093_98 (4).jpeg\",\"1542620093_98 (5).jpeg\",\"1542620093_98 (6).jpeg\"]', 'A modern and newly constructed apartment located in Taimani Project. The tower is adjacent to the street, it is equipped with central heating system and the basement is used as the parking lot. The apartment is on the fifth floor and has large and bright rooms, modernly designed kitchen, large hall and a balcony. You can also buy the apartment with the rooftop. The rooftop is 136 m2 and together with the apartment is sold for $70,000. The apartment is newly built and haven’t been used yet. \r\nاین اپارتمان ۳ اطاقه عصری و نو ساخت در سرک چهارم پروژه تایمنی موقعیت دارد و با سیستم مرکز گرمی مجهز میباشد. این اپارتمان در منزل ۵ است و و دارای اطاق های بزرگ و روشن، آشپزخانه زیبا و باز، دهلیز بزرگ و بالکن آفتاب رخ میباشد. همچنان، زیرزمینی این تاور به حیث پارکنگ وسایط استفاده میشود. این آپارتمان را میتوانید با تخت بام آن یکجای به ۷۰،۰۰۰ دالر نیز خریداری کنید.تخت بام آن ۱۳۶ مترمربع میباشد', '34.5575144', '69.15364879999993', '2018-11-19 16:34:53', '2018-11-19 16:34:53'),
