(304, 43, 'apartment', 'Apartment', 'sell', 'Kabul', 'Kabul', '6', 'Shura Street', 'm2', '123', NULL, '3', '2', '104550', '[\"1543308932_99 (1).jpeg\",\"1543308932_99 (2).jpeg\",\"1543308932_99 (3).jpeg\",\"1543308932_99 (4).jpeg\"]', 'Your ideal apartment in Arsalan Khalid Tower. The tower is adjacent to the Shura street and is equipped with modern day central heating system and solar powered elevator. It has high security measurements and the building is guarded 24/7 by professional guards. The tower includes an enormous supermarket, jewelry store, gym for male and female, 24 hours’ electricity and free internet connection. The apartment is on the 2nd floor and includes large and pleasing rooms, an open kitchen and a balcony. The rooms receive direct sunlight during the day and the interior design includes beautiful wallpapered walls, tiled hallway and carpeted rooms. The perfect place to live with your family.\r\nآپارتمان رویای تان در ارسلان خالد تاور در نبش سرک شورا. این آپارتمان با سیستم مدرن مرکز گرمی و لفت سولری مجهز بوده که حتا در نبود برق نیز از آن استفاده کرده میتوانید. دارای تدابیر بالای امنیتی است و توسط گارد های مسلکی به طور ۲۴ ساعته نگهبانی میگردد. این برج شامل سوپرمارکیت بزرگ و مجهز، طلا فروشی، کلپ ورزشی برای آقایان و خانمان، برق ۲۴ ساعته و انترنت رایگان میباشد. آپارتمان فوق در منزل ۲ واقع بوده و دارای اطاق های بزرگ، زیبا و آفتاب رخ، آشپزخانه باز و بالکن با نمای زیبا میباشد. فضای داخل آن توسط طراحان مسلکی طراحی گردیده است و دیوار های آن با کاغذ های زیبای دیواری دیزاین شده است. همچنان، دارای اطاق های فرش شده و دهلیز کاشی کاری شده میباشد', '34.4979248', '69.13881379999998', '2018-11-27 15:55:32', '2018-11-27 15:55:32'),
