(339, 47, 'apartment', 'Apartment', 'rent', 'Kabul', 'Kabul', '6', 'Shura Street', 'm2', '135', NULL, '3', '2', '650', '[\"1543393554_114 (1).jpeg\",\"1543393554_114 (2).jpeg\",\"1543393554_114 (3).jpeg\",\"1543393554_114 (5).jpeg\"]', 'Your ideal apartment in Arsalan Khalid Tower. The tower is adjacent to the Shura street and is equipped with modern day central heating system and solar powered elevator. It has high security measurements and the building is guarded 24/7 by professional guards. The tower includes an enormous supermarket, jewelry store, gym for male and female, 24 hours’ electricity and free internet connection. The apartment is on the 3rd floor and includes large and pleasing rooms, an open kitchen and a balcony. The rooms receive direct sunlight during the day and the interior design includes beautiful wallpapered walls, tiled hallway and rooms. To rent the apartment, you need to do a 1-year contract and pay 6 month’s rent in advance. You also have to deposit $1000 in advance as insurance for the apartment.\r\nآپارتمان رویای تان در ارسلان خالد تاور در نبش سرک شورا. این آپارتمان با سیستم مدرن مرکز گرمی و لفت سولری مجهز بوده که حتا در نبود برق نیز از آن استفاده کرده میتوانید. دارای تدابیر بالای امنیتی است و توسط گارد های مسلکی به طور ۲۴ ساعته نگهبانی میگردد. این برج شامل سوپرمارکیت بزرگ و مجهز، طلا فروشی، کلپ ورزشی برای آقایان و خانمان، برق ۲۴ ساعته و انترنت رایگان میباشد. آپارتمان فوق در منزل ۳ واقع بوده و دارای اطاق های بزرگ، زیبا و آفتاب رخ، آشپزخانه باز و بالکن با نمای زیبا میباشد. فضای داخل آن توسط طراحان مسلکی طراحی گردیده است و دیوار های آن با کاغذ های زیبای دیواری دیزاین شده است. برای کرایه این آپارتمان، شما باید حد اقل برای یک سال قرارداد نموده و کرایه ۶ ماه آنرا پیش پرداخت نمایید. همچنان، باید ۱۰۰۰ دالر را به شکل ضمانت به دفتر ارسلان خالد پرداخت نمایید', '34.4979248', '69.13881379999998', '2018-11-28 15:25:54', '2018-11-28 15:25:54'),
