(352, 30, 'house', 'House / Office', 'rent', 'Kabul', 'Kabul', '10', 'Qalai Fatehullah', 'biswa', '4', '4', '12', '4', '2000', '[\"1544430603_WhatsApp Image 2018-12-09 at 12.12.31 (1).jpeg\",\"1544430603_WhatsApp Image 2018-12-09 at 12.12.31.jpeg\",\"1544430603_WhatsApp Image 2018-12-09 at 12.12.33 (1).jpeg\",\"1544430603_WhatsApp Image 2018-12-09 at 12.12.33.jpeg\",\"1544430603_WhatsApp Image 2018-12-09 at 12.12.34.jpeg\"]', 'The building is available for rent and you can use it as your house or office. The building is in great condition and has a big yard and a garden. It is freshly painted and includes large and bright rooms with a modern kitchen. The building has good security measurement and is equipped with a safe room. It also has 6 carpeted rooms and a big garage.\r\nیک تعمیر عالی و عصری برای دفتر کار و یا مکان زنده گی برای فامیل شما. این تعمیر دارای حویلی بزرگ، اطاق های تازه رنگ شده، روشن و آفتاب رخ، و آشپزخانه مدرن میباشد. دارای تدابیر خوب امنیتی بوده و شامل اطاق امن نیز میباشد. ۶ اطاق این خانه فرش شده است و پارکنگ موتر آن گنجایش چندین موتر را همزمان دارا میباشد', '34.5553974', '69.1715302', '2018-12-10 15:30:03', '2018-12-10 15:30:03'),
(353, 30, 'office', 'Office', 'rent', 'Kabul', 'Kabul', '10', 'Qalai Fatehullah', 'biswa', '4', '4', '12', NULL, '2000', '[\"1544430750_133 (1).jpeg\",\"1544430750_133 (2).jpeg\",\"1544430750_133 (3).jpeg\",\"1544430750_133 (4).jpeg\",\"1544430750_133 (5).jpeg\"]', 'The building is available for rent and you can use it as your house or office. The building is in great condition and has a big yard and a garden. It is freshly painted and includes large and bright rooms with a modern kitchen. The building has good security measurement and is equipped with a safe room. It also has 6 carpeted rooms and a big garage.\r\n یک تعمیر عالی و عصری برای دفتر کار و یا مکان زنده گی برای فامیل شما. این تعمیر دارای حویلی بزرگ، اطاق های تازه رنگ شده، روشن و آفتاب رخ، و آشپزخانه مدرن میباشد. دارای تدابیر خوب امنیتی بوده و شامل اطاق امن نیز میباشد. ۶ اطاق این خانه فرش شده است و پارکنگ موتر آن گنجایش چندین موتر را همزمان دارا میباشد', '34.5553974', '69.1715302', '2018-12-10 15:32:30', '2018-12-10 15:32:30');
