(354, 51, 'house', 'House', 'sell', 'Kabul', 'Kabul', '12', 'Ahmad Shah Baba Meena', 'm2', '300', '5', '17', '12', '295000', '[\"1544438084_134 (1).jpeg\",\"1544438084_134 (2).jpeg\",\"1544438084_134 (3).jpeg\",\"1544438084_134 (4).jpeg\",\"1544438084_134 (5).jpeg\",\"1544438084_134 (7).jpeg\",\"1544438084_134 (8).jpeg\",\"1544438084_134 (9).jpeg\",\"1544438084_134 (11).jpeg\",\"1544438084_134 (12).jpeg\",\"1544438084_134 (14).jpeg\",\"1544438084_134 (15).jpeg\",\"1544438084_134 (16).jpeg\",\"1544438084_134 (17).jpeg\",\"1544438084_134 (19).jpeg\",\"1544438084_134 (20).jpeg\",\"1544438084_134 (21).jpeg\"]', 'A beautiful 5 story building available for sale. The building is newly built and is equipped with central heating system and furnished rooms. It includes a large basement, 17 large and bright rooms, 12 bathrooms and 7 kitchens. The interior decoration includes beautiful wooden cupboards on each room, furnished floor and curtained windows. You can also partition it to 6 apartments, each apartment including 3 rooms, 2 bathrooms and a kitchen.\r\n\r\nاین تعمیر زیبا و عصری دارای ۵ منزل میباشد و  به فروش گذاشته شده است. دارای تهکوی بزرگ، ۱۷ اطاق، ۱۲ تشناب و ۷ آشپز خانه بوده و با سیستم مرکز گرمی مجهز میباشد. اطاق های آن بزرگ، آفتاب رخ و با الماری های مدرن و پرده های زیبا تزیین گردیده است. خانه مذکور را  به ۶ اپارتمان نیز تقسیم نموده میتوانید. این خانه در مجموع گنجایش ۶ فامیل را در شش واحد جدا گانه دارا میباشد', '34.5117964', '69.32947200000001', '2018-12-10 17:34:44', '2018-12-10 17:34:44'),
(355, 51, 'office', 'Office', 'sell', 'Kabul', 'Kabul', '12', 'Ahmad Shah Baba Meena', 'm2', '300', '5', '17', NULL, '295000', '[\"1544438436_134 (22).jpeg\",\"1544438436_134 (23).jpeg\",\"1544438436_134 (24).jpeg\",\"1544438436_134 (25).jpeg\",\"1544438436_134 (26).jpeg\",\"1544438436_134 (27).jpeg\",\"1544438436_134 (28).jpeg\",\"1544438436_134 (29).jpeg\",\"1544438436_134 (30).jpeg\",\"1544438436_134 (32).jpeg\",\"1544438436_134 (33).jpeg\",\"1544438436_134 (34).jpeg\",\"1544438436_134 (35).jpeg\",\"1544438436_134 (36).jpeg\",\"1544438436_134 (39).jpeg\",\"1544438436_134 (40).jpeg\",\"1544438436_134 (41).jpeg\"]', 'A beautiful 5 story building available for sale. The building is newly built and is equipped with central heating system and furnished rooms. It includes a large basement, 17 large and bright rooms, 12 bathrooms and 7 kitchens. The interior decoration includes beautiful wooden cupboards on each room, furnished floor and curtained windows. You can use the building as your house and office at the same time.\r\nاین تعمیر زیبا و عصری دارای ۵ منزل میباشد و  به فروش گذاشته شده است. دارای تهکوی بزرگ، ۱۷ اطاق، ۱۲ تشناب و ۷ آشپز خانه بوده و با سیستم مرکز گرمی مجهز میباشد. اطاق های آن بزرگ، آفتاب رخ و \r\n با الماری های مدرن و پرده های زیبا تزیین گردیده است. تعمیر مذکور را میتوانید برای خانه و دفتر کاری تان به شکل همزمان استفاده کنید', '34.5117964', '69.32947200000001', '2018-12-10 17:40:36', '2018-12-10 17:40:36'),
(356, 52, 'apartment', 'Apartment', 'sell', 'Kabul', 'Kabul', '4', 'Parwan 3', 'biswa', '1', NULL, '14', '10', '300000', '[\"1544439206_WhatsApp Image 2018-11-13 at 10.31.15 AM.jpeg\",\"1544439206_WhatsApp Image 2018-11-13 at 10.31.38 AM(1).jpeg\",\"1544439206_WhatsApp Image 2018-11-13 at 10.31.38 AM.jpeg\"]', 'This house is located in Parwan Seh with the most amazing architecture and design. It is newly constructed and as seen in the pictures, it is a house in the corner. The house has large rooms with balconies and modern bathrooms and a kitchen with all available facilities. It has one large basement and a spacious rooftop with a beautiful view. \r\nاین خانه در پاروان سئه با شگفت انگیز ترین معماری و طراحی واقع شده است. این به تازگی ساخته شده است و همانطور که در تصاویر دیده می شود، یک خانه در نبش است. خانه دارای اتاق های بزرگ با بالکن و حمام های مدرن و آشپزخانه با تمام امکانات در دسترس است. این یک زیرزمین بزرگ و یک سقف بزرگ و منظره زیبا دارد.', '34.5463854', '69.12831649999998', '2018-12-10 17:53:26', '2018-12-10 17:53:26'),
(357, 39, 'house', 'House', 'rent', 'Kabul', 'Kabul', '4', 'Taimani Project', 'm2', '62', '1', '2', '2', '105', '[\"1544596052_135 (1).jpeg\",\"1544596052_135 (2).jpeg\",\"1544596052_135 (3).jpeg\",\"1544596052_135 (4).jpeg\"]', 'It is a decent looking house for rent in Taimani Project. The house includes a garage for two cars and two medium sized rooms. \r\nاین خانه دارای ۲ اطاق متوسط بوده و دارای گراچ موتر نیز میباشد. کرایه آخر آن ۸۰۰۰ افغانی میباشد', '34.5575144', '69.15364879999993', '2018-12-12 13:27:32', '2018-12-12 13:27:32'),
